import Vue from "vue";
import Vuex from "vuex";
import users from "./modules/users";
import userGroup from "./modules/userGroup";
import account from "./modules/account";
import global from "./modules/global";

Vue.use(Vuex);

export default new Vuex.Store({
    modules: {
        users,
        userGroup,
        account,
        global
    }
});
